import logo from './logo.svg';
import './App.css';
import FirstTabs from './dashboard/FirstTabs.js'
import facebookIcon from './images/iconFacebook.svg'
import instagramIcon from '../src/images/iconInstagram.svg'
import twitterIcon from './images/iconTwitter.svg'
import youtubeIcon from './images/iconYoutube.svg'

const firstTabs = [{
  icon: fa,
  user: '@nathanf',
  number: '1987',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '12 Today',
},
{
  icon: twitterIcon,
  user: '@nathanf',
  number: '1044',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '99 Today',
},
{
  icon: instagramIcon,
  user: '@realnathanf',
  number: '11k',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '1099 Today',
},
{
  icon: youtubeIcon,
  user: 'Nathan F.',
  number: '8239',
  type: 'Subscribers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#DC414C" fill-rule="evenodd" d="M0 0l4 4 4-4z"/></svg>,
  isEnough: false,
  howMany: '144 Today',
}]

function App() {
  return (
    <div className="App">
      <FirstTabs tabList={firstTabs}/>
    </div>
  );
}

export default App;
